import React from 'react';
import '../css/Skills.css'; // Ensure you have this CSS file

const skillCategories = {
    "Programming Languages": [
        { name: 'Python', level: 90 },
        { name: 'R', level: 80 },
        { name: 'SQL', level: 85 },
        { name: 'Java', level: 75 }
    ],
    "Libraries/Frameworks": [
        { name: 'JavaScript', level: 80 },
        { name: 'React', level: 80 },
        { name: 'Pandas', level: 90 },
        { name: 'Numpy', level: 85 },
        { name: 'Seaborn', level: 85 },
        { name: 'Matplotlib', level: 85 },
        { name: 'Scikit-learn', level: 90 },
        { name: 'Scipy', level: 80 },
        { name: 'dplyr', level: 75 },
        { name: 'tidyr', level: 75 },
        { name: 'ggplot', level: 70 }
    ],
    "Tools / Platforms": [
        { name: 'Git', level: 90 },
        { name: 'Github', level: 90 },
        { name: 'Tableau', level: 85 },
        { name: 'Power BI', level: 85 },
        { name: 'AWS', level: 80 },
        { name: 'RedShift', level: 80 },
        { name: 'Snowflake', level: 80 },
        { name: 'Apache Airflow', level: 75 },
        { name: 'Jira', level: 80 },
        { name: 'Asana', level: 75 },
        { name: 'Prometheus', level: 70 },
        { name: 'Grafana', level: 70 },
        { name: 'TensorFlow', level: 80 },
        { name: 'PyTorch', level: 75 },
        { name: 'ETL', level: 80 },
        { name: 'Google Analytics API', level: 70 },
        { name: 'Alpha Vantage API', level: 70 },
        { name: 'Databricks', level: 75 },
        { name: 'BigQuery', level: 75 },
        { name: 'Cloud Storage', level: 75 },
        { name: 'gcloud CLI', level: 70 },
        { name: 'Cloud SDK', level: 70 }
    ],
    "Databases": [
        { name: 'SQL', level: 85 },
        { name: 'MongoDB', level: 75 },
        { name: 'Google Firebase', level: 70 }
    ]
};

const Skills = () => {
    return (
        <section className="skills-section">
            <h2 className="section-title">Skills</h2>
            {Object.entries(skillCategories).map(([category, skills]) => (
                <div key={category} className="skills-category">
                    <h3 className="category-title">{category}</h3>
                    <div className="skills-list">
                        {skills.map(skill => (
                            <div key={skill.name} className="skill-item">
                                <div className="skill-name">{skill.name}</div>
                                <div className="skill-bar-background">
                                    <div className="skill-bar" style={{ width: `${skill.level}%` }}></div>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            ))}
        </section>
    );
};

export default Skills;
